import React from 'react'
import {Chart} from 'react-google-charts'

class MainBarChart extends React.Component{
    render(){
        return(
        <div className='mainPieChart'>
        <Chart
        width={'500px'}
        height={'300px'}
         chartType="Bar"
         loader={<div>Loading Chart</div>}
         /*
         data={[
           ['Expense', 'Dollars'],
           ['Phone', 110],
           ['Food', 200],
           ['Gas', 250],
           ['Car', 600],
           ['Rent', 700],
         ]}
         */
         data={this.props.barChartData}
         options={{
           title: 'Expenses',
           vAxis: {
               title: 'dollars',
           },
         }}
         rootProps={{ 'data-testid': '1' }}
        />
        </div>
        )
    }
}

export default MainBarChart
